/**
 * Available GPU backends for image processing acceleration
 */
export enum GpuBackend {
  /**
   * WebGPU backend (preferred, best performance)
   */
  WebGPU = 0,
  /**
   * WebGL2 backend (fallback, good compatibility)
   */
  WebGL2 = 1,
  /**
   * No GPU acceleration available (CPU fallback)
   */
  None = 2,
}

export class GpuBackendInfo {
  private constructor();
  free(): void;
  [Symbol.dispose](): void;
  readonly backend: GpuBackend;
  readonly available: boolean;
  readonly status_message: string;
  readonly webgpu_supported: boolean;
  readonly webgl2_supported: boolean;
  readonly estimated_memory_mb: number | undefined;
  readonly adapter_info: string;
}

/**
 * Processing backend types in order of preference
 * Note: For single-threaded WASM + Web Worker architecture
 */
export enum ProcessingBackend {
  /**
   * WebGPU accelerated processing (fastest)
   */
  WebGPU = 0,
  /**
   * WebGL2 accelerated processing (fast fallback)
   */
  WebGL2 = 1,
  /**
   * CPU single-threaded processing (standard fallback)
   */
  CpuSingleThreaded = 2,
}

export class ProcessingConfig {
  free(): void;
  [Symbol.dispose](): void;
  constructor();
  try_gpu_acceleration: boolean;
  max_attempt_time_ms: number;
  aggressive_fallback: boolean;
  cache_backend_selection: boolean;
}

export class WasmCapabilityReport {
  private constructor();
  free(): void;
  [Symbol.dispose](): void;
  readonly threading_supported: boolean;
  readonly shared_array_buffer: boolean;
  readonly cross_origin_isolated: boolean;
  readonly web_workers: boolean;
  readonly proper_headers: boolean;
  readonly environment_type: string;
  readonly missing_requirements: any[];
  readonly diagnostics: any[];
  readonly is_node_js: boolean;
  readonly atomics_supported: boolean;
  readonly webgpu_supported: boolean;
  readonly webgl2_supported: boolean;
  readonly gpu_backend: string;
}

